  false,\n\t\"url\": null,\n\t\"notes\": \"The NOAA Coastal Services Center's Legislative
  Atlas is a regional geographic information system (GIS) that provides spatial data
  for state and federal coastal and ocean management laws and the jurisdictional boundaries
  of management agencies. There are a growing number of regional collaborations among
  federal, state, and local agencies to address coastal management issues that cut
  across existing political and jurisdictional boundaries. To support regional management
  efforts, the Coastal Services Center has developed geographic representations of
  key state and federal legislation and the jurisdictional boundaries of state and
  federal management agencies.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
